form {
    text-align: left;

    label {
        display: block;
        margin-bottom: 1rem;
        color: #fff;
        font-size: 1.2rem;
        text-align: left;
    }

    input {
        height: 6rem;
        line-height: 6rem;
        font-size: 1.4rem;
        padding: 0 1.5rem;
        border-radius: 4px;
        margin-bottom: 1.5rem;
        width: 100%;
        border: none;
    }

    textarea {
        height: 16rem;
        line-height: 1.8rem;
        font-size: 1.4rem;
        padding: 1.5rem;
        border-radius: 4px;
        margin-bottom: 1.5rem;
        width: 100%;
        border: none;
    }

    .file {
        background: #111;
        color: #fff;
        font-weight: 600;
        border-radius: 4px;
        display: flex;
        align-items: center;
        padding: 0 3rem;
        height: 6rem;
        font-size: 1.6rem;
        justify-content: center;
        cursor: pointer;

        svg {
            width: 2rem;
            margin-right: 1.5rem;
        }
    }

    button {
        display: inline-block;
        padding: 0 5rem;
        font-size: 1.6rem;
        height: 6rem;
        line-height: 6rem;
        border: none;
        cursor: pointer;
        border-radius: 4px;
        background: #74ab72;
        color: #fff;
        font-weight: 600;
    }
}

